import React from 'react';
import Footer from './footer/Footer';
function Page404(){
    const pageStyle = {
        'textAlign': 'center',
        'marginTop': '90px'
    }
    return (
        <div style={pageStyle}>
            404 Page Not Found!
            <Footer />
        </div>
    )
}
export default Page404;
